/*
  pdf.worker.min.js (local shim)

  This small shim proxies to the official pdf.js worker hosted on cdnjs.
  Using `importScripts` avoids checking the large worker into git while
  providing a same-origin URL that the app can point to: `/static/js/v2/pdf.worker.min.js`.

  Version: 3.11.174
*/

try {
    importScripts('https://cdnjs.cloudflare.com/ajax/libs/pdf.js/3.11.174/pdf.worker.min.js');
    // eslint-disable-next-line no-console
    console.log('pdf.worker shim loaded remote worker from cdnjs');
} catch (e) {
    // eslint-disable-next-line no-console
    console.error('Failed to load remote pdf.worker via shim:', e && e.message ? e.message : e);
}
